import DefaultParser, * as ModuleParser from '@babel/parser'
import FileSystem from 'fs-extra'
import Path from 'path'
import Test from 'ava'
import Touch from 'touch'
import DefaultTraverse, * as ModuleTraverse from '@babel/traverse'

import { Transform } from '../../index.js'

const { 'parse': Parse } = DefaultParser || ModuleParser
const FilePath = __filePath
const FolderPath = Path.dirname(FilePath)
const Require = __require
const Traverse = DefaultTraverse.default || ModuleTraverse.default

Test('createModuleFromPath(sourcePath, targetPath, option) using file', async (test) => {

  let sourcePath = `${FolderPath}/resource/transform/create-module-from-path/file/00-content.pug`
  let targetPath = `${FolderPath}/resource/transform/create-module-from-path/file/00-content${Path.extname(FilePath)}`

  // succeeds writing target
  await test.notThrowsAsync(Transform.createModuleFromPath(sourcePath))
  test.true(await FileSystem.pathExists(targetPath))

  // succeeds (but writes nothing) with no change to source
  await test.notThrowsAsync(Transform.createModuleFromPath(sourcePath))

  // fails to overwrite as 'flag' defaults to 'wx' with changed source 
  await Touch(sourcePath)
  await test.throwsAsync(Transform.createModuleFromPath(sourcePath), { 'code': 'EEXIST'})

  // succeeds to overwrite as 'flag' is 'w' with changed source 
  let option = { 'flag': 'w' }

  await Touch(sourcePath)
  await test.notThrowsAsync(Transform.createModuleFromPath(sourcePath, targetPath, option))

  // succeeds to overwrite as 'flag' is 'w' with changed source, utility import is defined
  let utility = null
  utility = Path.relative(Path.dirname(sourcePath), Require.resolve('../../library/utility.js'))
  option = { 'flag': 'w', 'utility': utility }

  await Touch(sourcePath)
  await test.notThrowsAsync(Transform.createModuleFromPath(sourcePath, targetPath, option))

  let content = await FileSystem.readFile(targetPath, { 'encoding': 'utf-8' })
  let ast = Parse(content, { 'sourceType': 'module' })

  let existsUtility = false 

  Traverse(ast, {
    CallExpression(path) {

      if (path.node.callee.name === 'require' &&
          path.node.arguments.length === 1 &&
          path.node.arguments[0].type === 'StringLiteral') {

        // test.log(`const Utility = require('${path.node.arguments[0].value}')`)
        test.is(path.node.arguments[0].value, utility)

        existsUtility = true

      }

    },
    ImportDeclaration(path) {

      // test.log(`import Utility from '${path.node.source.value}'`)
      test.is(path.node.source.value, utility)

      existsUtility = true

    }
  })

  test.true(existsUtility)

})

Test('createModuleFromPath(sourcePath, targetPath, option) using folder', async (test) => {

  let sourcePath = `${FolderPath}/resource/transform/create-module-from-path/folder`
  let targetPath = [
    `${FolderPath}/resource/transform/create-module-from-path/folder/00-content${Path.extname(FilePath)}`,
    `${FolderPath}/resource/transform/create-module-from-path/folder/01-content${Path.extname(FilePath)}`,
    `${FolderPath}/resource/transform/create-module-from-path/folder/02-content${Path.extname(FilePath)}`
  ]

  // succeeds writing target
  await test.notThrowsAsync(Transform.createModuleFromPath(sourcePath))
  targetPath.forEach((targetPath) => test.true(FileSystem.pathExistsSync(targetPath)))

  // succeeds (but writes nothing) with no change to source
  await test.notThrowsAsync(Transform.createModuleFromPath(sourcePath))

  // fails to overwrite as 'flag' defaults to 'wx' with changed source 
  await Touch(`${sourcePath}/02-content.pug`)
  await test.throwsAsync(Transform.createModuleFromPath(sourcePath), { 'code': 'EEXIST'})

})

Test('createModuleFromPath(sourcePath, targetPath, option) using sub-folder', async (test) => {

  let sourcePath = `${FolderPath}/resource/transform/create-module-from-path/sub-folder`
  let targetPath = [
    `${FolderPath}/resource/transform/create-module-from-path/sub-folder/folder/00-content${Path.extname(FilePath)}`,
    `${FolderPath}/resource/transform/create-module-from-path/sub-folder/folder/01-content${Path.extname(FilePath)}`,
    `${FolderPath}/resource/transform/create-module-from-path/sub-folder/folder/02-content${Path.extname(FilePath)}`,
    `${FolderPath}/resource/transform/create-module-from-path/sub-folder/00-content${Path.extname(FilePath)}`,
    `${FolderPath}/resource/transform/create-module-from-path/sub-folder/01-content${Path.extname(FilePath)}`,
    `${FolderPath}/resource/transform/create-module-from-path/sub-folder/02-content${Path.extname(FilePath)}`
  ]

  // succeeds writing target
  await test.notThrowsAsync(Transform.createModuleFromPath(sourcePath))
  targetPath.forEach((targetPath) => test.true(FileSystem.pathExistsSync(targetPath)))

  // succeeds (but writes nothing) with no change to source
  await test.notThrowsAsync(Transform.createModuleFromPath(sourcePath))

  // fails to overwrite as 'flag' defaults to 'wx' with changed source 
  await Touch(`${sourcePath}/folder/02-content.pug`)
  await test.throwsAsync(Transform.createModuleFromPath(sourcePath), { 'code': 'EEXIST'})

})

import DefaultBabel, * as ModuleBabel from '@babel/core'
import ESLint from 'eslint'
import FileSystem from 'fs-extra'
import _Format from 'prettier'
import Is from '@pwn/is'
import JSON5 from 'json5'
import Lex from 'pug-lexer'
import Link from 'pug-linker'
import Load from 'pug-load'
import Match from 'minimatch'
import Merge from 'deepmerge'
import Parse from 'pug-parser'
import Path from 'path'

import { Package } from './package.js'
import BlockNode from './node/block-node.js'

import { UnrecognizedMessageTransformError } from './error/unrecognized-message-transform-error.js'

const { 'ESLint': Lint } = ESLint
const { 'format': Format } = _Format
const Babel = DefaultBabel || ModuleBabel
const FilePath = __filePath
const Require = __require

class Transform {

  static getASTFromContent(content, option = { 'path': '(unknown)' }) {

    let lexerOutput = Lex(content, { 'filename': option.path })
    let parserOutput = Parse(lexerOutput, { 'filename': option.path })
    let loaderOutput = Load(parserOutput, { 'lex': Lex, 'parse': Parse })
    let AST = Link(loaderOutput)

    return AST

  }

  static async getSourceFromContent(content, option = { 'path': '(unknown)' }) {

    let AST = this.getASTFromContent(content, option)
    let blockNode = new BlockNode(AST, option)
    let blockSource = await blockNode.getSource()

    let source = `  function __getNode(__utility = {}) { 
                      const __node = []
                      ${blockSource}
                      return __node
                    }`

    let local = await this._getLocalFromSource(source)

    return { source, local }

  }

  static async getFunctionSourceFromContent(content, option = { 'path': '(unknown)' }) {

    let { source, local } = await this.getSourceFromContent(content, option)

    local = local
      .map((local) => `const { ${local} } = __local`)
      .join('\n')

    source =  ` function __getNode(__local = {}, __utility = {}) {
                  ${local}
                  ${source} 
                  return __getNode(__utility) 
                }`

    return source

  }

  static async getFunctionFromContent(content, option = { 'path': '(unknown)' }) {

    let source = null
    source = await this.getFunctionSourceFromContent(content, option)
    source = await this.formatSource(source)

    let fn = null
    eval(`fn = ${source}`)

    return fn

  }

  static async getModuleSourceFromContent(content, userOption = {}) {

    let defaultOption = {
      'path': '(unknown)',
      'utility': '@virtualpatterns/mablung-virtual-pug/utility'
    }

    let option = Merge(defaultOption, userOption)

    let source = null
    source = await this.getFunctionSourceFromContent(content, { 'path': option.path })
    source =  ` // Created by ${Package.name} v${Package.version}
                // Path = ${option.path === '(unknown)' ? option.path : `'${Path.relative('', option.path)}'`}
                import Utility from '${option.utility}'
                ${source}
                export default function(__local = {}, __utility = Utility) { 
                  return __getNode(__local, __utility) 
                }`

    return source

  }

  static async getASTFromPath(path) {

    let content = await FileSystem.readFile(path, { 'encoding': 'utf-8' })
    let AST = this.getASTFromContent(content, { 'path': path })

    return AST

  }

  static async getSourceFromPath(path) {

    let content = await FileSystem.readFile(path, { 'encoding': 'utf-8' })
    let source = await this.getSourceFromContent(content, { 'path': path })

    return source

  }

  static async getFunctionSourceFromPath(path) {

    let content = await FileSystem.readFile(path, { 'encoding': 'utf-8' })
    let source = await this.getFunctionSourceFromContent(content, { 'path': path })

    return source

  }

  static async getFunctionFromPath(path) {

    let content = await FileSystem.readFile(path, { 'encoding': 'utf-8' })
    let fn = await this.getFunctionFromContent(content, { 'path': path })

    return fn

  }

  static async getModuleSourceFromPath(path, option) {

    let content = await FileSystem.readFile(path, { 'encoding': 'utf-8' })
    let source = await this.getModuleSourceFromContent(content, { ...option, 'path': path })

    return source

  }

  static async createModuleFromPath(sourcePath, targetPath = FileSystem.statSync(sourcePath).isDirectory() ? sourcePath : `${Path.dirname(sourcePath)}/${Path.basename(sourcePath, Path.extname(sourcePath))}${Path.extname(FilePath)}`, userOption = {}) {

    let defaultOption = {
      'encoding': 'utf-8',
      'flag': 'wx'
    }

    let option = Merge(defaultOption, userOption)

    let sourceInformation = await FileSystem.stat(sourcePath)

    if (sourceInformation.isDirectory()) {

      let includePattern = [ '*.pug' ]
      let excludePattern = [ '*.skip.pug' ]

      let item = await FileSystem.readdir(sourcePath, { 'encoding': 'utf-8', 'withFileTypes': true })

      let createModule = []

      createModule = createModule.concat(item
        .filter((item) => item.isDirectory())
        .map((folder) => this.createModuleFromPath(`${sourcePath}/${folder.name}`, `${targetPath}/${folder.name}`, option)))

      createModule = createModule.concat(item
        .filter((item) => item.isFile())
        .filter((file) => includePattern.reduce((isMatch, pattern) => isMatch ? isMatch : Match(file.name, pattern), false))
        .filter((file) => !excludePattern.reduce((isMatch, pattern) => isMatch ? isMatch : Match(file.name, pattern), false))
        .map((file) => this.createModuleFromPath(`${sourcePath}/${file.name}`, `${targetPath}/${Path.basename(file.name, Path.extname(file.name))}${Path.extname(FilePath)}`, option)))

      return Promise.all(createModule)

    } else {

      let isCreated = false

      if (await FileSystem.pathExists(targetPath)) {

        let targetInformation = await FileSystem.stat(targetPath)

        // console.log(`Existing '${Path.relative('', targetPath)}' ...`)
        // console.log(`Source ${sourceInformation.mtime}`)
        // console.log(`Target ${targetInformation.mtime}`)

        if (sourceInformation.mtime >= targetInformation.mtime) {
          isCreated = true
        }

      } else {
        isCreated = true
      }

      if (isCreated) {

        let source = null
        source = await this.getModuleSourceFromPath(sourcePath, option)
        source = await this.formatSource(source, Path.extname(targetPath).toUpperCase() === '.CJS' ? 'commonjs' : 'esmodule')

        // console.log(`Creating '${Path.relative('', targetPath)}' ...`)

        await FileSystem.ensureDir(Path.dirname(targetPath))
        return FileSystem.writeFile(targetPath, source, { 'encoding': option.encoding, 'flag': option.flag })

      } else {
        return Promise.resolve()
      }

    }

  }

  static async formatSource(sourceIn, environment = Path.extname(FilePath).toUpperCase() === '.CJS' ? 'commonjs' : 'esmodule') {

    let configuration = null
    configuration = JSON5.parse(await FileSystem.readFile(Require.resolve('./transform.babelrc.json')), { 'encoding': 'utf-8' })
    configuration = configuration.env[environment]

    let { 'code': sourceOut } = await Babel.transformAsync(sourceIn, configuration)

    sourceOut = Format(sourceOut, {
      'arrowParens': 'always',
      'bracketSpacing': true,
      'parser': 'babel',
      'quoteProps': 'preserve',
      'semi': false,
      'singleQuote': true,
      'tabWidth': 2,
      'trailingComma': 'none'
    })

    return sourceOut

  }

  static async _getLocalFromSource(source) {

    let configuration = JSON5.parse(await FileSystem.readFile(Require.resolve('./transform.eslintrc.json')), { 'encoding': 'utf-8' })
    let lint = new Lint({ 'baseConfig': configuration })

    let result = await lint.lintText(source)
    let pattern = /^'(.*)' is not defined.$/i

    let local = null
    local = result[0].messages
      .filter((message) => message.ruleId === 'no-undef')
      .map((message) => message.message)
      .map((message) => {

        let match = null

        if (Is.not.null(match = pattern.exec(message))) {
          let [ , local ] = match
          return local
        } else {
          throw new UnrecognizedMessageTransformError(message)
        }

      })
      .reduce((accumulator, local) => {
        accumulator[local] = undefined
        return accumulator
      }, {})

    local = Object.keys(local)

    return local

  }

}

export { Transform }

import { TransformError } from './transform-error.js'

class UnrecognizedMessageTransformError extends TransformError {

  constructor(message) {
    super(`The message '${message}' is not recognized.`)
  }

}

export { UnrecognizedMessageTransformError }

import Path from 'path'

import { TransformError } from './transform-error.js'

class UnsupportedAttributeTransformError extends TransformError {

  constructor(attribute) {
    super(`Escaped attributes are not supported (${Path.relative('', attribute.filename)}:${attribute.line}:${attribute.column}).`)
  }

}

export { UnsupportedAttributeTransformError }

import Path from 'path'

import { TransformError } from './transform-error.js'

class UnsupportedCodeTransformError extends TransformError {

  constructor(node) {
    super(`Buffered, escaped code is not supported (${Path.relative('', node.filename)}:${node.line}:${node.column}).`)
  }

}

export { UnsupportedCodeTransformError }

import Path from 'path'

import { TransformError } from './transform-error.js'

class UnsupportedCommentTransformError extends TransformError {

  constructor(node) {
    super(`Buffered comments are not supported (${Path.relative('', node.filename)}:${node.line}:${node.column}).`)
  }

