export { UnsupportedTagTransformError }

import FileSystem from 'fs-extra'
import JSON5 from 'json5'

const Require = __require

const Package = JSON5.parse(FileSystem.readFileSync(Require.resolve('../../package.json'), { 'encoding': 'utf-8' }))

export { Package }

class TransformError extends Error {

  constructor(...parameter) {
    super(...parameter)
  }

}

export { TransformError }

import Node from '../node.js'

class BlockNode extends Node {

  constructor(node, option) {
    super(node, option)
  }

  get isEmpty() {
    return this._node.nodes.length <= 0
  }

  async getSource() {

    if (this.isEmpty) {
      return `// BlockNode.isEmpty = ${this.isEmpty}`
    } else {

      let childNode = await Promise.all(this._node.nodes.map((childNode) => Node.createNode(childNode, this._option)))

      let childSource = null
      childSource = await Promise.all(childNode.map((childNode) => childNode.getSource()))
      childSource = childSource.join('\n')

      return childSource

    }

  }

}

export default BlockNode

import DefaultChangeCase, * as ModuleChangeCase from 'change-case'
import Path from 'path'

const FilePath = __filePath
const { 'paramCase': ParameterCase } = DefaultChangeCase || ModuleChangeCase

class Node {

  constructor(node, option) {
    this._node = node
    this._option = option
  }

  async getSource() {}

  static async createNode(node, option) {

    let extension = null
    extension = Path.extname(FilePath)
    extension = extension.toLowerCase()

    let nodeClass = null
    nodeClass = await import(`./node/${ParameterCase(node.type)}-node${extension}`)
    nodeClass = nodeClass.default || nodeClass

    return new nodeClass(node, option)

  }

}

export default Node

import BlockAttributeNode from './block-attribute-node.js'
import BlockNode from './block-node.js'
import Node from '../node.js'

import { UnsupportedTagTransformError } from '../error/unsupported-tag-transform-error.js'

class TagNode extends Node {

  constructor(node, option) {
    super(node, option)
  }

  async getSource() {

    if (this._node.selfClosing) {
      throw new UnsupportedTagTransformError(this._node)
    } else {

      let blockAttributeNode = new BlockAttributeNode(this._node, this._option)

      let blockAttributeSource = null
      blockAttributeSource = await blockAttributeNode.getSource()
      blockAttributeSource = blockAttributeNode.isEmpty ? 
        '{}' : 
        `(() => { 
           const __attributeNode = {}
           ${blockAttributeSource}
           return __attributeNode
         })()`

      let blockNode = new BlockNode(this._node.block, this._option)

      let blockSource = null
      blockSource = await blockNode.getSource()
      blockSource = blockNode.isEmpty ? 
        '[]' : 
        `(() => { 
           const __node = []
           ${blockSource}
           return __node
         })()`

      return  `__node.push(__utility.createNode('${this._node.name}', ${blockAttributeSource}, ${blockSource}))`

    }

  }

}

export default TagNode

import BlockNode from './block-node.js'
import Node from '../node.js'

import { UnsupportedCodeTransformError } from '../error/unsupported-code-transform-error.js'

class CodeNode extends Node {

  constructor(node, option) {
    super(node, option)
  }

  async getSource() {

    if (this._node.buffer) {

      if (this._node.mustEscape) {
        throw new UnsupportedCodeTransformError(this._node)
      } else {

        return  ` {
                    let value = ${this._node.val}
                    if (typeof value === 'string') {
                      __node.push(...[__utility.convertToNode(value)].flat())
                    } else {
                      __node.push(value)
                    }
                  }`

      }

    } else {

      if (this._node.block) {

        let blockNode = new BlockNode(this._node.block, this._option)
        let blockSource = blockNode.isEmpty ? '' : await blockNode.getSource()

        return  ` ${this._node.val} { 
                    ${blockSource}
                  }`

      } else {
        return this._node.val
      }

    }

  }

}

export default CodeNode

import Node from '../node.js'
import AndAttributeNode from './and-attribute-node.js'
import AttributeNode from './attribute-node.js'

class BlockAttributeNode extends Node {

  constructor(node, option) {
    super(node, option)
  }

  get isEmpty() {
    return (this._node.attrs.length + this._node.attributeBlocks.length) <= 0
  }

  async getSource() {

    let attributeNode = [ ...this._node.attrs.map((node) => new AttributeNode(node, this._option)), ...this._node.attributeBlocks.map((node) => new AndAttributeNode(node, this._option)) ]

    let attributeSource = null
    attributeSource = await Promise.all(attributeNode.map((attributeNode) => attributeNode.getSource()))
    attributeSource = attributeSource.join('\n')

    return attributeSource

  }

}

export default BlockAttributeNode

import Node from '../node.js'

class AndAttributeNode extends Node {

  constructor(andAttribute, option) {
    super(andAttribute, option)
    this._andAttribute = andAttribute
  }

  getSource() {
    return `__utility.addAndAttribute(${this._andAttribute.val}, __attributeNode)`
  }

}

export default AndAttributeNode

import Node from '../node.js'

import { UnsupportedAttributeTransformError } from '../error/unsupported-attribute-transform-error.js'

class AttributeNode extends Node {

  constructor(attribute, option) {
    super(attribute, option)
    this._attribute = attribute
  }

  getSource() {

    if (this._attribute.mustEscape) {
      throw new UnsupportedAttributeTransformError(this._attribute)
    } else {
      return `__utility.addAttribute('${this._attribute.name}', ${this._attribute.val}, __attributeNode)`
    }

  }

}

export default AttributeNode

import URL from 'url'

import { SourceMapSupport } from './index.cjs'

SourceMapSupport.install({ 
  'handleUncaughtExceptions': false, 
  'retrieveSourceMap': function(source) {

    if (/^file:/.test(source)) {
      return SourceMapSupport.retrieveSourceMap(URL.fileURLToPath(source))
    } else {
      return null
    }

  }
})

// @flow

// ## Token types

// The assignment of fine-grained, information-carrying type objects
// allows the tokenizer to store the information it has about a
// token in a way that is very cheap for the parser to look up.

// All token type variables start with an underscore, to make them
// easy to recognize.

// The `beforeExpr` property is used to disambiguate between regular
// expressions and divisions. It is set on all token types that can
// be followed by an expression (thus, a slash after them would be a
// regular expression).

// The `startsExpr` property is used to determine whether an expression
// may be the argument subexpression of a `yield` expression or
// `yield` statement. It is set on all token types that may be at the
// start of a subexpression.

// `isLoop` marks a keyword as starting a loop, which is important
// to know when parsing a label, in order to allow or disallow
// continue jumps to that label.

const beforeExpr = true;
const startsExpr = true;
const isLoop = true;
const isAssign = true;
const prefix = true;
const postfix = true;

type TokenOptions = {
  keyword?: string,
  beforeExpr?: boolean,
  startsExpr?: boolean,
  rightAssociative?: boolean,
  isLoop?: boolean,
  isAssign?: boolean,
  prefix?: boolean,
  postfix?: boolean,
  binop?: ?number,
};

export class TokenType {
  label: string;
  keyword: ?string;
  beforeExpr: boolean;
  startsExpr: boolean;
  rightAssociative: boolean;
  isLoop: boolean;
  isAssign: boolean;
  prefix: boolean;
  postfix: boolean;
  binop: ?number;
  updateContext: ?(prevType: TokenType) => void;

  constructor(label: string, conf: TokenOptions = {}) {
    this.label = label;
    this.keyword = conf.keyword;
    this.beforeExpr = !!conf.beforeExpr;
    this.startsExpr = !!conf.startsExpr;
    this.rightAssociative = !!conf.rightAssociative;
    this.isLoop = !!conf.isLoop;
    this.isAssign = !!conf.isAssign;
    this.prefix = !!conf.prefix;
    this.postfix = !!conf.postfix;
    this.binop = conf.binop != null ? conf.binop : null;
    this.updateContext = null;
  }
}

export const keywords = new Map<string, TokenType>();

function createKeyword(name: string, options: TokenOptions = {}): TokenType {
  options.keyword = name;
  const token = new TokenType(name, options);
  keywords.set(name, token);
  return token;
}

function createBinop(name: string, binop: number) {
  return new TokenType(name, { beforeExpr, binop });
}

export const types: { [name: string]: TokenType } = {
  num: new TokenType("num", { startsExpr }),
  bigint: new TokenType("bigint", { startsExpr }),
  decimal: new TokenType("decimal", { startsExpr }),
  regexp: new TokenType("regexp", { startsExpr }),
  string: new TokenType("string", { startsExpr }),
  name: new TokenType("name", { startsExpr }),
  eof: new TokenType("eof"),

  // Punctuation token types.
  bracketL: new TokenType("[", { beforeExpr, startsExpr }),
  bracketHashL: new TokenType("#[", { beforeExpr, startsExpr }),
  bracketBarL: new TokenType("[|", { beforeExpr, startsExpr }),
  bracketR: new TokenType("]"),
  bracketBarR: new TokenType("|]"),
  braceL: new TokenType("{", { beforeExpr, startsExpr }),
  braceBarL: new TokenType("{|", { beforeExpr, startsExpr }),
  braceHashL: new TokenType("#{", { beforeExpr, startsExpr }),
  braceR: new TokenType("}"),
  braceBarR: new TokenType("|}"),
  parenL: new TokenType("(", { beforeExpr, startsExpr }),
  parenR: new TokenType(")"),
  comma: new TokenType(",", { beforeExpr }),
  semi: new TokenType(";", { beforeExpr }),
  colon: new TokenType(":", { beforeExpr }),
  doubleColon: new TokenType("::", { beforeExpr }),
  dot: new TokenType("."),
  question: new TokenType("?", { beforeExpr }),
  questionDot: new TokenType("?."),
  arrow: new TokenType("=>", { beforeExpr }),
  template: new TokenType("template"),
  ellipsis: new TokenType("...", { beforeExpr }),
  backQuote: new TokenType("`", { startsExpr }),
  dollarBraceL: new TokenType("${", { beforeExpr, startsExpr }),
  at: new TokenType("@"),
  hash: new TokenType("#", { startsExpr }),

  // Special hashbang token.
  interpreterDirective: new TokenType("#!..."),

  // Operators. These carry several kinds of properties to help the
  // parser use them properly (the presence of these properties is
  // what categorizes them as operators).
  //
  // `binop`, when present, specifies that this operator is a binary
  // operator, and will refer to its precedence.
  //
  // `prefix` and `postfix` mark the operator as a prefix or postfix
  // unary operator.
  //
  // `isAssign` marks all of `=`, `+=`, `-=` etcetera, which act as
  // binary operators with a very low precedence, that should result
  // in AssignmentExpression nodes.

  eq: new TokenType("=", { beforeExpr, isAssign }),
